desc:
Activate 1 of these effects;
● Fusion Summon 1 Fusion Monster from your Extra Deck using monsters you control or in your hand, including at least 1 &#x201C;Dark Magician&#x201D; or &#x201C;Dark Magician Girl&#x201D; as materials.
● Ritual Summon 1 Ritual Monster from your hand by Tributing monster(s) you control or in your hand, including at least 1 &#x201C;Dark Magician&#x201D; or &#x201C;Dark Magician Girl&#x201D;, whose combined levels are greater than or equal to the level of the Ritual Monster.
